     document.getElementById('advtext').insertBefore(newDiv, null); scrollit(); }
   
function zapit()
   { document.getElementById('comform').innerHTML = ''; }
function shutit(text)
{
   zapit();
   writeit(text + '<div align=center class="red"><p><span class="red">The game engine has stopped.</span></p>' +
      '</div>');
   document.getElementById('shutit').focus();
}
function init()
{
  FS.mkdir('/adv550');
  FS.mount(IDBFS, {}, '/adv550');
  FS.chdir('/adv550');
  FS.syncfs(true, init2);
}
function init2(err)
{
  if (err)
    { alert("IDBFS error: " + err) }
  else
  {
    conbot = document.getElementById('conbot');
    advtext = document.getElementById('advtext');
    advcom = document.getElementById('advcom');
    gameInfo = advTurn('_INFO_HTML_').split('|');
    document.title = gameInfo[0];
    document.getElementById('gameid').innerHTML = gameInfo[1];
    var gameList = advTurn('_LIST_').split('|');
    var savedGames = document.getElementById('saved');
    var count = 0;
    var first = 1;
    if (gameList.length > 0)
    {
      for (var i = 0; i < gameList.length; i++)
      {
        if (!gameList[i]) continue;
        document.getElementById('youcan').style.display = 'inline';
        if (gameList[i].match(/^\./))
          { document.getElementById('resume').style.display = 'inline' }
        else
        {
          if (first)
          {
            first = 0; 
            savedGames.innerHTML += '<div class="txtsaved"><b>or load a saved game:</bb></div>';
          }
          savedGames.innerHTML += 
            (count == 0 ? '<br>' : '&nbsp;&nbsp') +
            '<div><input type=button class=qbutt ' +
            "value='" + gameList[i] + "' " + 'onclick="javascript:startit(' + 
            "'_LOAD_" + gameList[i] + "'" + ')"></div>';
          if (++count == 5)
            count = 0;
        }
      }
    }
  }
}
function keyDown(ev)
{
   var e = ev;
   var code = (e.charCode || e.keyCode);
   if (code == 16)
     return false;
   if (code == 13)
   {
     doit('');
     return false;
   }
   if (code == 38 || code == 187 || code == 107) 
      code = 1;
   else if (code == 40 || code == 189 || code == 109)
      code = -1;
   else
      code = 0;
   
   if (code != 0)
      hist(code);

   return false;
}
function hist(step)
{
   var h = 2 * hpos;
   hcom[h] = advcom.value;
   hpos += step;
   if (hpos < 0) hpos = 0;
   if (hpos > hsiz) hpos = hsiz;
   h = 2 * hpos;
   if (! hcom[h + 1])
      hcom[h + 1] = hcom[h];
   advcom.value = hcom[h];
   advcom.focus();
   return;
}
function showit(text)
{
   var type = text.substr(0, 1);
   if (type != 'k')
   {
      rType = type;
      writeit(text.substr(1));
      if (type == 'f')
         shutit('');
      else if (started)
         advcom.focus();
      FS.syncfs(function(error) {
        if (error)
          alert("Error while syncing" +  error);
      });
   }
}
function doit(cmd)
{
   var com = advcom.value;
   var pars;
   turn++;
   hcom[0] = com;
   var prompt = document.getElementById('prompt');
   if (prompt)
   {
      var el = document.createElement('span');
      var tx = (rType == 'q' || rType == 'm' ||
                rType == 'r' || rType == 's') ?
                   prompt.innerHTML : '&gt;';
      if (rType == 'c') tx = '<br>';
      el.className = 'query';
      el.innerHTML = tx + ' ' + com +
          (rType == 't' ? '<br>&nbsp<br>' : '');
      prompt.parentNode.replaceChild(el, prompt);
      el = null;
   }
   advcom.value = '';
   if (com && ! com.match(/^_/))
   {
      var i;
      for (i = 1; i < hcom.length; i += 2)
      {
         if (hcom[i])
         {
            hcom[i - 1] = hcom[i];
            hcom[i] = '';
         }
      }
      if (hcom[0] == hcom[2])
         hcom[0] = '';
      else
      {
         hcom.unshift('');
         hcom.unshift('');
         hsiz++;
      }
   }
   hpos = 0;
   if (cmd) com = cmd
   else if (started == 0)
     com = '_START_';
   showit(advTurn(com));
   started = 1;
   var kids = document.getElementsByName('chunk');
   if (kids.length > moveLimit)
   {
      kids[0].parentNode.removeChild(kids[0]);
      hcom.pop();
      hcom.pop();
      hsiz--;
   }
}
function startit(what)
{
  document.getElementById('startit').style.display = 'none';
  document.getElementById('gameview').style.display = 'block';
  document.getElementById('advcom').focus();
  advcom.value = what;
  doit(what);
}
